      // Register messages from parent window

      function startFrontLoadDashboardEmbed(config) {
        if (
          performanceOptimization === "false" ||
          config.type !== "dashboard"
        ) {
          return;
        }

        // Front load dashboard embed: resolveCluster & getDashboardContainer requests will be sent in parallel
        // to scripts download to improve dashboard embed performance.
        // The promises will replace HttpService calls.

        // Set groupId for front load. for folders use empty groupId
        if ("" == "2") {
          config.groupId = "";
        } else {
          config.groupId =
            config.groupId == null || config.groupId == ""
              ? "be8908da-da25-452e-b220-163f52476cdd"
              : config.groupId;
        }

        // Initiate promises
        getDashboardContainerPromise = defer();

        if (
          embedUrlConfig.clusterUrl == null ||
          embedUrlConfig.clusterUrl == ""
        ) {
          resolveClusterPromise = defer();
          resolveCluster(config, getDashboardContainer);
        } else {
          getDashboardContainer(config, embedUrlConfig.clusterUrl);
        }
      }

      // Handle message from parent window
      function receiveMessage(event) {
        if (event.data) {
          try {
            let messageData;
            try {
              messageData = JSON.parse(event.data);
            } catch (e) {
              messageData = event.data;
            }

            if (messageData.action === "loadDashboard") {
              dashboardObjectId = messageData.dashboardObjectId;
              accessToken = messageData.accessToken;
              tokenType = messageData.tokenType;
              pageView = messageData.pageView;
              groupId = messageData.groupId;
              uid = "defaultId";
              sdkSessionId =
                messageData.headers && messageData.headers["sdkSessionId"];
              if (isDashboardEmbedControllerInitialized) {
                loadDashboard(
                  dashboardObjectId,
                  accessToken,
                  groupId,
                  pageView,
                  tokenType
                );
              } else {
                isLoadDashboardMessagePending = true;
              }
            } else if (
              messageData.method === "POST" &&
              messageData.url === "/dashboard/load" &&
              !isDashboardEmbedControllerInitialized
            ) {
              dashboardObjectId = messageData.body.id;
              accessToken = messageData.body.accessToken;
              tokenType = messageData.body.tokenType;
              pageView = messageData.body.pageView;
              groupId = messageData.body.groupId;
              uid = messageData.headers && messageData.headers["uid"];
              sdkSessionId =
                messageData.headers && messageData.headers["sdkSessionId"];
              isLoadDashboardMessagePending = true;
            } else if (
              messageData.method === "POST" &&
              messageData.url === "/frontload/config"
            ) {
              // Frontload config is sent after Powerbi-Javascript receive the ready post message
              startFrontLoadDashboardEmbed(messageData.body);
            }
          } catch (e) {
            var dashboardEmbedLoadMessage = {
              event: "error",
              error: "Invalid message data:" + e.message,
            };
            window.parent.postMessage(
              JSON.stringify(dashboardEmbedLoadMessage),
              "*"
            );
            return;
          }
        }

    <script>
      var resolveClusterPromise;

      var clusterResolutionFrontLoadStartTime = null;
      var clusterResolutionFrontLoadEndTime = null;

      const tokenPrefix = ["Bearer ", "EmbedToken "];
      const unknownErrorCode = 500;
      const resolveClusterPrefix = "resolveCluster";

      function resolveCluster(config, nextFrontloadCall) {
        try {
          clusterResolutionFrontLoadStartTime = Date.now();
          var activityId = telemetrySessionId;
          var requestId = "e34ead52-50db-4953-8284-11349e05dc86";

          var xhr = new XMLHttpRequest();
          xhr.onreadystatechange = function() {
            try {
              var status = xhr.status;
              if (xhr.readyState == XMLHttpRequest.DONE) {
                clusterResolutionFrontLoadEndTime = Date.now();
                if (isSuccess(status)) {
                  var response = xhrBuildResponse(xhr, activityId, requestId);
                  if (response.data.clusterUrl || response.data.backendUrl) {
                    resolvedClusterUri =
                      response.data.clusterUrl || response.data.backendUrl;
                    resolveClusterPromise.resolve(response);
                    nextFrontloadCall(config, resolvedClusterUri);
                  } else {
                    resolveClusterPromise.reject(
                      buildExceptionResponse(
                        activityId,
                        requestId,
                        { message: "clusterUrl and backendUrl are empty" },
                        resolveClusterPrefix
                      )
                    );
                  }
                } else {
                  try {
                    resolveClusterPromise.reject(
                      xhrBuildResponse(
                        xhr,
                        activityId,
                        requestId,
                        true /*isError*/
                      )
                    );
                  } catch (e) {
                    // Cannot parse an error out of the response
                    resolveClusterPromise.reject(
                      buildExceptionResponse(
                        activityId,
                        requestId,
                        e,
                        resolveClusterPrefix
                      )
                    );
                  }
                }
              }
            } catch (e) {
              resolveClusterPromise.reject(
                buildExceptionResponse(
                  activityId,
                  requestId,
                  e,
                  resolveClusterPrefix
                )
              );
            }
          };

          let url;
          if (isSaaSEmbedWithAADToken(config)) {
            url = clusterUri + "/powerbi/globalservice/v201606/clusterdetails";
          } else {
            url = clusterUri + "/metadata/cluster";
          }

          xhr.open("GET", url);
          setGETRequestHeaders(xhr, telemetrySessionId, requestId, config);
          xhr.send();
        } catch (e) {
          resolveClusterPromise.reject(
            buildExceptionResponse(
              activityId,
              requestId,
              e,
              resolveClusterPrefix
            )
          );
        }
      }

      function setGETRequestHeaders(xhr, activityId, requestId, config) {
        xhr.setRequestHeader("Accept", "application/json");
        xhr.setRequestHeader("ActivityId", activityId);
        xhr.setRequestHeader("RequestId", requestId);

        // Default token type is Aad (0)
        let tokenType = config.tokenType || 0;
        xhr.setRequestHeader(
          "Authorization",
          tokenPrefix[tokenType] + config.accessToken
        );
      }

      function setGETRequestHeadersWithGroupId(
        xhr,
        activityId,
        requestId,
        config
      ) {
        setGETRequestHeaders(xhr, activityId, requestId, config);
        xhr.setRequestHeader("X-PowerBI-User-GroupId", config.groupId);
      }

      function setPOSTRequestHeaders(xhr, activityId, requestId, config) {
        setGETRequestHeaders(xhr, activityId, requestId, config);
        xhr.setRequestHeader("Content-Type", "application/json");
        xhr.setRequestHeader("X-PowerBI-User-GroupId", config.groupId);
      }

      function isSaaSEmbedWithAADToken(config) {
        // Default token type is Aad (0)
        const tokenType = config.tokenType || 0;
        return window.isSaasEmbed === true && tokenType === 0;
      }

      function defer() {
        let res, rej;

        let promise = new Promise((resolve, reject) => {
          res = resolve;
          rej = reject;
        });

        promise.resolve = result => {
          res(result);
        };

        promise.reject = error => {
          rej(error);
        };

        return promise;
      }

      function xhrBuildResponse(xhr, activityId, requestId, isError) {
        let response = {
          activityId: activityId,
          requestId: requestId,
          status: xhr.status,
        };

        xhrResponse = xhr.response && JSON.parse(xhr.response);
        if (!isError) response["data"] = xhrResponse;
        else response["error"] = xhrResponse && xhrResponse.error;

        return response;
      }

      function buildExceptionResponse(
        activityId,
        requestId,
        exception,
        prefix
      ) {
        return {
          activityId: activityId,
          requestId: requestId,
          status: unknownErrorCode,
          error: {
            message: prefix + " Exception: " + exception.message,
            code: "FrontLoadException",
          },
        };
      }

      function isSuccess(status) {
        return status >= 200 && status < 300;
      }
